import React from 'react';


function Header() {
    let title = "";

    const client = "Designers";

    if (client === "Designer") {
        title = "Design is my life";
    } else {
        title = "Programming is my life";
    }


    return (
        // jsx {javascript} jsx
        <div className="navbar bg-primary">
            <h1 className="text-white">{title}</h1>
        </div>
    );
}

export default Header;
